import styled from 'styled-components';

const ContainerButton = styled.div`
  position: absolute;
  top: 615px;
  display: flex;
  gap: 13px;
  width: 439px;
  height: 278px;
  z-index: 2;

  .btn-ranking {
    background: #00D5E2;
  }
`;

export default ContainerButton;
